import React from 'react';

function AnalysisSection({ activeTab, rsiAnalysis, macdAnalysis }) {
    return (
        <div className="analysis-section">
            <h2>분석</h2>
            {activeTab === 'RSI' && (
                <div className="analysis-display">
                    {/* RSI 분석 결과를 표시 */}
                    <div className="textbox">
                        <h4 className="analysis-text">과매수/과매도</h4>
                        <p>RSI 분석 결과...</p>
                    </div>
                </div>
            )}
            {activeTab === 'MACD' && (
                <div className="analysis-display">
                    {/* MACD 분석 결과를 표시 */}
                    <div className="textbox">
                        <h4 className="analysis-text">MACD 분석</h4>
                        <p>MACD 분석 결과...</p>
                    </div>
                </div>
            )}
            {/* 다른 분석 섹션을 여기에 추가 */}
        </div>
    );
}

export default AnalysisSection;
